description:
Your Favourite Attenborough Moment 

Biography, Nature Documentary hosted by David Attenborough, published by UKTV in 2006 - English narration


Information
------------------------------

Your Favourite Attenborough Moment
This tribute show counts down the top 20 moments from Sir David Attenborough's many series, according to audience votes. Featuring the clips, comments from selected celebrity admirers and, of course, words from Sir David himself.

